import React, {Component} from 'react';
import { Container } from '@material-ui/core';
import kansas from './Kansas.svg';

export default class KansasMap extends Component{
    render()
    {

        return <div><SVG src={kansas}/></div>;
        return(
            <div>
                <Container>
                <object id="svg-object" data={kansas} className="App-logo" alt="logo" style={{width:"100%", height:"auto"}}/>
                </Container>

            </div>
        );
    }
}
